const Description = () => {
  return (
    <div>
      Recipe Name 
      <img className="edit-icon" src={editIcon} alt="edit"></img>
      <div className="flex-container">
        <div className="flex-item">'
          <IngredientList />
        </div>
        <div className="flex-item">
          <PurchaseList />
        </div>
      </div>
    </div>
)
}

export default Description;
